import { useState, useEffect } from 'react'
import { Logo,FormRow } from '../components'
import Wrapper from '../assets/wrappers/RegisterPage'
import Alert from '../components/Alert'

const initialState = {
  name: '',
  email: '',
  password: '',
  showAlert: true,
  isMember: true
}

const Register = () => {
  const [values, setValues] = useState(initialState);
  


  const handleChange = (e) => {
    console.log(e.target);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    console.log(e.target);
  };
  return (
    <Wrapper className='full-page'>
      <form className='form' onSubmit={onSubmit}>
        <Logo />
        <h3>Login</h3>
        {false && <Alert />}
        {/* name input*/}
        <FormRow type ="text" name = "Name" value={values.name} handleChange={handleChange} />
        {/*  email*/}
        <FormRow type ="text" name = "Email" value={values.email} handleChange={handleChange} />
        {/*  pass*/}
        <FormRow type ="text" name = "Password" value={values.password} handleChange={handleChange} />
        <button type="submit" className='btn btn-block' >aaa</button>
      </form>

    </Wrapper>
  )
}

export default Register
